
import numpy as np

def hourMinSec2deg(h, m, s):
    return 360/24 * (h + m/60 + s/3600)

sign = lambda x: (1, -1)[x<0]
def degMinSec2deg(d, m, s):
    return sign(d) * (abs(d) + m/60 + s/3600)

class Star:
    def __init__(self, nom, alpha, declinaison, magnitude_apparente):
        self.name = nom
        self.alpha = alpha
        self.decl = declinaison
        self.magn_app = magnitude_apparente
    
    def get_pos(self):
        x = np.cos(np.deg2rad(self.alpha)) * np.cos(np.deg2rad(self.decl))
        y = np.sin(np.deg2rad(self.alpha)) * np.cos(np.deg2rad(self.decl))
        z = np.sin(np.deg2rad(self.decl))
        return x, y, z
    
    def __str__(self):
        return f"Star : (name:{self.name}, alpha:{self.alpha}, declinaison:{self.decl})"

    def __repr__(self):
        return f"Star({self.name}, {self.alpha}, {self.decl})"
